import React from 'react';

import { MiniBlock, MiniBlockTitle, MiniBlockInput, MiniBlockForm } from '../UI/MiniBlock/MiniBlock';
import './Auth.sass';
import SimpleButton from '../UI/SimpleButton/SimpleButton';

import logo from '../../img/logo.png';

export default function Register() {
  [fields, setField] = useState({});

  return (
    <div className="auth-screen">
      
      <div className="auth-screen__logo">
        <img src={logo} alt=""/>
      </div>

      <MiniBlock className="auth-screen__form">
        <MiniBlockTitle>Регистрация</MiniBlockTitle>
        

        <MiniBlockForm>
          <MiniBlockInput onChange={() => {}} placeholder="Логин" />
          <MiniBlockInput onChange={() => {}} placeholder="Email" />
          <MiniBlockInput onChange={() => {}} type="password" placeholder="Пароль" />
          <MiniBlockInput onChange={() => {}} type="password" placeholder="Повторите пароль" />

          <SimpleButton className="auth-screen__form-button" width="wide">Зарегистрироваться</SimpleButton>
        </MiniBlockForm>
        
      </MiniBlock>
    </div>
  );
}
